import "./App.css";
import "./css/bootstrap.css";

import HomePage from "./components/HomePage";
// import Main from "./components/Main";
import Slides from "./components/Slides";
import Main from "./components/Main";
import { Routes } from "react-router-dom";

function App() {
  return (
    <div className="App ">
      <HomePage />
      <Routes>
        <Route path="/home">
          <Main />
        </Route>
      </Routes>
    </div>
  );
}

export default App;
